            </>
            <>
            <BannerImg src = {Banner2} alt ="banner2"/>
            </>
            <>
            <BannerImg src ={Netflix1} alt ="Netflix1"/>
            </>
            <>
            <BannerImg src = {Banner2} alt ="banner2"/>
            </>


            </Slider>
            </Container>
        </div>
    );
}

const Container = styled.div`
	/* width: 1600px; */
    /* height: 1000px; */
    margin: 0px;
    /* overflow-x:scroll;
    scroll-snap-type: x mandatory; */

    /* overflow:hidden; */

  .slick-dots {
    .slick-active {
      button::before {
        color: #c1c1c1;
      }
    }
    button::before {
      color: #e9e9e9;
    }
  }
`;
const BannerImg = styled.img`
  height: 10%;

  width:95%;
  border-radius:30px;
  /* margin:10px; */
  padding:10px;


`;
